import React, { memo } from "react";

import { FriendWrapper } from "./style";
export default memo(function LJFriend() {
  return (
    <FriendWrapper>
      <div className="main wrap-v2">
        <div className="image">
          <a href="/#/friend" className="login">
            <span></span>
          </a>
        </div>
      </div>
    </FriendWrapper>
  );
});
